import React, { Component } from 'react';
import './App.css';
import Display from './Display';

class App extends Component {
  state={
    displayInfos: [
      { name: 'Karan', age: 21, birthMonth: 'April' },
      { name: 'James', age: 22, birthMonth: 'May' },
      { name: 'John', age: 23, birthMonth: 'June' }
    ]
  }

  render() {
    return (
      <div className="App">
      <h1> This is my App</h1>
      <p>React!! </p>
      <Display name='Karan' age ='21' birthMonth='April' />
      <Display name='James' age ='24' birthMonth='December' />
      </div>
    );
  }
}

export default App;
